import React, { useContext, useEffect, useState } from "react";
import { eel } from "../../eel";
import { FocusedLogIndexContext } from "../FocusedLogIndexContext";
import { LogDetailsContainer, SingleLogDetail } from "./LogDetails.style";

type LogDetailsProps = {
  focusedLogIndex: number;
};
type LogDetailsResult = {
  date: string;
  ip: string;
  host: string;
  [index: string]: string;
};

export const LogDetails = () => {
  const [logDetails, setLogDetails] = useState<LogDetailsResult>({
    date: "",
    ip: "",
    host: "",
  });

  const { focusedLogIndex } = useContext(FocusedLogIndexContext);

  useEffect(() => {
    console.log("Executed useEffect");
    eel.getLogDetails(focusedLogIndex)((el) => {
      console.log(el);
      setLogDetails(el);
    });
    console.log(focusedLogIndex);
  }, [focusedLogIndex]);

  {
    logDetails ? Object.values(logDetails).map((el) => <div>el</div>) : "";
  }

  return (
    <>
      <LogDetailsContainer>
        {logDetails
          ? Object.keys(logDetails).filter((el)=>Boolean(logDetails[el])).map((el: string) => (
              <SingleLogDetail>
                {logDetails[el] ? el + "  " + logDetails[el] : ""}
              </SingleLogDetail>
            ))
          : ""}
      </LogDetailsContainer>
    </>
  );
};
